import './App.css';
import { Container, Image, Row, Col } from 'react-bootstrap';
import { Forum as ForumType } from "./Forum.js";

type ForumProps = {
  forum: ForumType;
};

function App({ forum }: ForumProps) {
  return (
    <Container className='m-5'>
      <Row className="border shadow-sm p-3 rounded ">
        <Col className='d-flex justify-content-center'>
          <Image src="profile.jpg" roundedCircle></Image>
        </Col>
        <Col className='m-auto'>
          <h3>Nickname</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer quis justo malesuada, euismod sem nec, porta risus. Proin rutrum arcu non auctor accumsan. Ut ultricies elit eget ex posuere, sit.</p>
        </Col>
      </Row>
      <Row className="border shadow-sm p-3 rounded ">
        <Col className='d-flex justify-content-center'>
          <Image src={forum.Zdjecie} roundedCircle></Image>
        </Col>
        <Col className='m-auto'>
          <h3>{forum.ID}</h3>
          <p>{forum.Wpis}</p>
        </Col>
      </Row>
    </Container>
  );
}

export default App;
